import React from 'react';
//import{Link} from "react-router-dom";
import './login.css';
function Login(){
    function con(){
        alert("LoggedIn Successfully");
    }
    return(
        <body>
        <div>    
            <div className='login'>
            <div className='image'>
            <img src="byjus.png" alt="logo" width="150" height="100"></img>
            </div>
            <p><b>Let's Get Started</b><br/>
            Enter your mobile number to sign up/ sign in to
            your BYJU'S account</p><br/>
            </div>
            <div className='form'>
            <div class="name">
            <label>Name:</label><br/>
            <input type="text"></input>
            </div><br/>
            <div class="phno">
            <label>Mobile No:</label><br/>
            <input type="number"></input>
            </div><br/>
            <div class="btn">
            <button onClick={con}>Continue</button>
            </div>
            </div>
        
        </div>  
        </body>
    )
} 
export default Login
